d','What personal data we collect and why we collect it',4,3,'h2','LINE','core/heading',0,'','5c410bf6b282fc7b447d22573e39dabf','optional',NULL),(925,'en','gutenberg-3','f96e9874a2de2cdd1fe0b8a1c6aa6951','Comments',4,4,'h3','LINE','core/heading',0,'','c4ac2e24c7dc20ac6fe0ff4613ec5e6f','optional',NULL),(926,'en','gutenberg-3','15457895bb970c750b1afa98567ccacc','When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.',4,5,'','AREA','core/paragraph',0,'','6d92eaff71144ac4d28ad0c1d1055211','optional',NULL),(927,'en','gutenberg-3','b959eb876826ab3e5061a64059055a24','An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.',4,6,'','AREA','core/paragraph',0,'','c2d463470642ce733686833d0aa866c4','optional',NULL),(928,'en','gutenberg-3','c4d6dbe16261202a8a2f0cea31ca8fd3','Media',4,7,'h3','LINE','core/heading',0,'','12675a823862c3668f5357ad51400b72','optional',NULL),(929,'en','gutenberg-3','9c6be572a444a512980d43e76e601e89','If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.',4,8,'','AREA','core/paragraph',0,'','1699ab584f7086282e1bb9a4508c1f1e','optional',NULL),(930,'en','gutenberg-3','07ba9d77d430d118d299360255dac4f1','Contact forms',4,9,'h3','LINE','core/heading',0,'','bc5b4ef748832b8eca1a1717aecd3cb3','optional',NULL),(931,'en','gutenberg-3','7a8d96f03f84c9ede39e1f8033cbeb46','Cookies',4,10,'h3','LINE','core/heading',0,'','5b3e5f105ae83b6b52e32f25b6e1a2bd','optional',NULL),(932,'en','gutenberg-3','f96c570e659d1e80084446210267f518','If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.',4,11,'','AREA','core/paragraph',0,'','5cd2c6cd76d8ab5ffdf98bd1e963155e','optional',NULL),(933,'en','gutenberg-3','dba7023a85d0bedcc5d270416cdbea66','If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.',4,12,'','AREA','core/paragraph',0,'','0937fb6340e3126453def837a4f1139d','optional',NULL),(934,'en','gutenberg-3','f3c6bbfeea481f0c62818305b1f1b649','When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.',4,13,'','AREA','core/paragraph',0,'','654950c62660e9b66d0d1333c523c06c','optional',NULL),(935,'en','gutenberg-3','3dd0a4229b899ec8637cf00ce4568714','If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.',4,14,'','AREA','core/paragraph',0,'','ae708292fe3d550570c6ac1c01259946','optional',NULL),(936,'en','gutenberg-3','daf72dcf13209e51ca0085df2e83e0f5','Embedded content from other websites',4,15,'h3','LINE','core/heading',0,'','651a5518863e352be421541e2ec2fed3','optional',NULL),(937,'en','gutenberg-3','9b9215d44174c699fcba1da009938299','Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.',4,16,'','AREA','core/paragraph',0,'','22c97f1a2a266f0f6029d1c068eca6af','optional',NULL),(938,'en','gutenberg-3','c7edd02bc3ad749d12747f0c08530128','These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.',4,17,'','AREA','core/paragraph',0,'','cedce8c898e878b521c62d6ac588b8ba','optional',NULL),(939,'en','gutenberg-3','d8d37c641f27b2d987f4be26c48a848a','Analytics',4,18,'h3','LINE','core/heading',0,'','f816bfc620880df6c64bc457c5d4358a','optional',NULL),(940,'en','gutenberg-3','28c82947e40dffe049b931f3c0bb3fce','Who we share your data with',4,19,'h2','LINE','core/heading',0,'','9e9b149af592d7827cb8e7ece03db846','optional',NULL),(941,'en','gutenberg-3','968ea77d93bdf6f40ddff1774eb49752','How long we retain your data',4,20,'h2','LINE','core/heading',0,'','c4b4d4df762c26fc76806d35c8d98def','optional',NULL),(942,'en','gutenberg-3','c69e1199dd0d38025613579db59719b9','If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.',4,21,'','AREA','core/paragraph',0,'','89c92847d10fd7f5e24f4ed49154ca53','optional',NULL),(943,'en','gutenberg-3','70345b8a1cc0ff4b6cacf313bfd58d7a','For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.',4,22,'','AREA','core/paragraph',0,'','bc4ba232d2af421fcc53c3475a7c2c02','optional',NULL),(944,'en','gutenberg-3','cdd4e5562c577440ea6142ddedf026bd','What rights you have over your data',4,23,'h2','LINE','core/heading',0,'','e8196e8f7b3561b9a7eb05d7af0b0841','optional',NULL),(945,'en','gutenberg-3','727cde41f2c6f389b029d3ac67dae1b1','If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.',4,24,'','AREA','core/paragraph',0,'','abb1a9f27a56324110abcf325c11cfe1','optional',NULL),(946,'en','gutenberg-3','e146d449e7a61237988d1e3e75c862d8','Where we send your data',4,25,'h2','LINE','core/heading',0,'','274066cface10dc50570c3879b466d9b','optional',NULL),(947,'en','gutenberg-3','ad34927851cf505388dd655eb28d9170','Visitor comments may be checked through an automated spam detection service.',4,26,'','LINE','core/paragraph',0,'','6cf850499c388b3c06b13a4551a6478a','optional',NULL),(948,'en','gutenberg-3','06bd9d38000a068b8e421c5b4056d929','Your contact information',4,27,'h2','LINE','core/heading',0,'','2703d6c68a8860001cffa06a452bfec1','optional',NULL),(949,'en','gutenberg-3','1145e37974b6064f7297286ce4c1d084','Additional information',4,28,'h2','LINE','core/heading',0,'','932575eabf132953dce67234e894b1fe','optional',NULL),(950,'en','gutenberg-3','150e5312a2327e382cd9d99ca04d2523','How we protect your data',4,29,'h3','LINE','core/heading',0,'','4c9219c4d0621946bc971337cbb737b9','optional',NULL),(951,'en','gutenberg-3','2628e1ddbe9850a6d8f94ba089af3584','What data breach procedures we have in place',4,30,'h3','LINE','core/heading',0,'','c8e31e2bf53a509e75c92d1c8c46772f','optional',NULL),(952,'en','gutenberg-3','b6cfcf7247f4a3e56b477c61b3ba7759','What third parties we receive data from',4,31,'h3','LINE','core/heading',0,'','b58dfa56881572008e2c41a1aceba501','optional',NULL),(953,'en','gutenberg-3','c679d23616d0090d0fdf22066ad2357a','What automated decision making and/or profiling we do with user data',4,32,'h3','LINE','core/heading',0,'','025e64587d3e1be2707f028f52eaf630','optional',NULL),(954,'en','gutenberg-3','feb3264957a93972d36fd96dc6987a2c','Industry regulatory disclosure requirements',4,33,'h3','LINE','core/heading',0,'','92be97eaa7c0423cab45ff0117860715','optional',NULL),(955,'en','gutenberg-2','56f657850b998d66a24eaf1c912d3495','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:',5,1,'','AREA','core/paragraph',0,'','ccb40be280c5ff37205b8d92229fee08','optional',NULL),(956,'en','gutenberg-2','e66285028ba3c394645459b7cd15e047','Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piña coladas. (And gettin\' caught in the rain.)',5,2,'','AREA','core/quote',0,'','75444e359e526dd8e0b03ac9352ba15f','optional',NULL),(957,'en','gutenberg-2','66415f712eacd1df62af7332979a6b8a','...or something like this:',5,3,'','LINE','core/paragraph',0,'','ecaf2221631d619c531d8cef2d97dc60','optional',NULL),(958,'en','gutenberg-2','79c202a201cfc85c89f0cd7eb7e7114a','The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.',5,4,'','AREA','core/quote',0,'','c627133af8d5b919f1219f34b0ab86c6','optional',NULL),(959,'en','gutenberg-2','e0d33fd54304aa2e3247da55ef378d5b','As a new WordPress user, you should go to <a href=\"http://wpml.localhost/wp/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!',5,5,'','VISUAL','core/paragraph',0,'','60b339655b638b2446d52f6da2887177','optional',NULL),(960,'en','Menu 1 menu','Menu Item Label 111','ENGLISH',NULL,NULL,'','LINE',NULL,0,'','58fd410c0fad3a5ea302126ab13a9559','optional',NULL),(961,'en','Menu 1 menu','Menu Item URL 111','/',NULL,NULL,'','LINE',NULL,0,'','a8bec7e5a617ee2c187a8dfa0d72b215','optional',NULL),(962,'en','Menu 1 menu','Menu Item Label 113','SPANISH',NULL,NULL,'','LINE',NULL,0,'','d763d9cd90b9ad09f8a729a79853aebb','optional',NULL),(963,'en','Menu 1 menu','Menu Item URL 113','/es/',NULL,NULL,'','LINE',NULL,0,'','f89da9cd4cda4aecdf759ca1e4837165','optional',NULL),(964,'en','Menu 1 - Spanish menu','Menu Item Label 111','ENGLISH',NULL,NULL,'','LINE',NULL,0,'','ef3571029e2738a95ba12cec6a3a9356','',NULL),(965,'en','Menu 1 - Spanish menu','Menu Item Label 113','SPANISH',NULL,NULL,'','LINE',NULL,0,'','acee5958b4f9c4d5463228504fbee768','',NULL),(966,'en','Menu 1 - Spanish menu','Menu Item URL 111','/',NULL,NULL,'','LINE',NULL,0,'','0469e562855bfb3ad57bc50217e3a08e','',NULL),(967,'en','Menu 1 - Spanish menu','Menu Item URL 113','/es/',NULL,NULL,'','LINE',NULL,0,'','aefafcfa32774d0a52e10eed62eff4df','',NULL);
